import React from 'react';

const LoginPage = () => {
  return (
    <div className="flex h-screen">
      <div className="flex flex-col justify-center w-1/2 pl-8">
        <h1 className="text-left text-5xl font-bold mb-4">Volunteer Management System</h1>
      </div>
      <div className="flex flex-col justify-center w-1/2 pr-8">
        <form className="bg-clip-border p-6 bg-violet-600 border-4 border-violet-300 ">
        <label>Email:</label>
        <input type="email" />
        <label>Password:</label>
        <input type="password" />
        <button>Log In</button>
        <button>Register</button>
        <a href = "">Forgot Password</a>
        </form>
      </div>
    </div>
  );
};

export default LoginPage;
